import Link from 'next/link';

const Navbar = () =>  (

    <div class="container">
        <ul class="nav navbar-nav">
            <li><Link href="/">Home</Link></li>
            <li><Link href="about">About Us</Link></li>
        </ul>        
    </div>

);


export default Navbar;
